import { DO_LIST_WITHDRAWAL, LIST_WITHDRAWAL_SUCCESS, LIST_WITHDRAWAL_FAILED, RESET_LIST_WITHDRAWAL, DO_REJECT, REJECT_SUCCESS, REJECT_FAILDED, DO_APPROVE, APPROVE_SUCCESS, APPROVE_FAILED } from '../../config/constant.js';


const INITIAL_STATE = {
  fetchingListWithdrawal: false,
  dataListWithdrawal: [],
  meta: null
}

export default function dataWithdrawal(state = INITIAL_STATE, action){
  switch(action.type) {
    case DO_LIST_WITHDRAWAL : {
      return {
        ...state,
        fetchingListWithdrawal: true
      }
    }
    case LIST_WITHDRAWAL_SUCCESS : {
      return {
        ...state,
        fetchingListWithdrawal: false,
        dataListWithdrawal: action.data,
        meta: action.meta
      }
    }
    case LIST_WITHDRAWAL_FAILED : {
      return {
        ...state,
        fetchingListWithdrawal: false
      }
    }
    case RESET_LIST_WITHDRAWAL : {
      return {
        ...state,
        fetchingListWithdrawal: false,
        dataListWithdrawal: []
      }
    }

    //REJECT
    case DO_REJECT : {
      return {
        ...state,
        fetchingListWithdrawal: true,
      }
    }
    case REJECT_SUCCESS : {
      return {
        ...state,
        fetchingListWithdrawal: false
      }
    }
    case REJECT_FAILDED  : {
      return {
        ...state,
        fetchingListWithdrawal: false
      }
    }

    //APPROVE
    case DO_APPROVE : {
      return {
        ...state,
        fetchingListWithdrawal: true
      }
    }
    case APPROVE_SUCCESS : {
      return {
        ...state,
        fetchingListWithdrawal: false
      }
    }
    case APPROVE_FAILED : {
      return {
        ...state,
        fetchingListWithdrawal: false
      }
    }
    default:
    return state
  }
}
